import Header from "./components/Layout/Header";
import Meals from "./components/Meals/Meals";
import Cart from "./components/Cart/Cart";

import { useState } from "react";

const App = () => {
  const [show, setShow] = useState(false);

  const onToggleModal = () => {
    if (show) {
      setShow(false);
    } else {
      setShow(true);
    }
  };

  return (
    <>
      <Cart onTo/>
      <Header />
      <main>
        <Meals />
      </main>
    </>
  );
}

export default App;
